room = ((None,None,1),(None, 2,3,4),(5,6,7,8,9),(None,'A','B','C'),(None,None,'D'))
#pos = (1,1)
pos = (2,0)
instructions = """



""".splitlines()


def move(pos, instr):
    (x,y) = pos
    if instr == "L":
        return x,y-1
    elif instr =="R":
        return x, y+1
    elif instr =="U":
        return x-1, y
    elif instr == "D":
        return x+1, y

def inroom(pos, room):
    try:
        return pos[0] >-1 and pos[1] > -1 and room[pos[0]][pos[1]]
    except IndexError:
        return False

for line in instructions:
    for s in line:
        nextpos = move(pos, s)
#        print(nextpos)
        if inroom(nextpos,room):
            pos = nextpos
#        print(pos)
#        print(room[pos[0]][pos[1]])
    print(room[pos[0]][pos[1]])
